import React from 'react';

function Header({ currentPage }) {
  return (
    <header>
      <h1>Tours and Travel</h1>
      <nav>
        {currentPage !== 'home' && <a href="#home">Home</a>}
        {currentPage !== 'tours' && <a href="#tours">Tours</a>}
      </nav>
    </header>
  );
}

export default Header;
